import axios from "axios"
//AIzaSyAYDx8imB7PesnnRObolzC8mpZlxRsshsU

export default axios.create({
    baseURL:"https://www.googleapis.com/youtube/v3",
    params: {
        part:"snippet",
        key:"AIzaSyAYDx8imB7PesnnRObolzC8mpZlxRsshsU",
        eventType:"live"&&"upcoming",
        maxResults:"10"
    }
});
